import React from 'react';
import './ScorecardTab.css';

const ScorecardTab = ({ match }) => {
  const matchData = match?.match || match; // handles both match.match and match

  if (!matchData) return <div>Loading match details...</div>;

  const {
    batting = [],
    bowling = [],
    lineup = [],
    scoreboards = [],
  } = matchData;

  // Map player_id to full name
  const playerIdToName = {};
  lineup.forEach(player => {
    playerIdToName[player.id] = player.fullname || `${player.firstname} ${player.lastname}`;
  });

  // Group batting and bowling by innings (scoreboard_id)
  const battingByInnings = {};
  batting.forEach(b => {
    if (!battingByInnings[b.scoreboard]) battingByInnings[b.scoreboard] = [];
    battingByInnings[b.scoreboard].push(b);
  });

  const bowlingByInnings = {};
  bowling.forEach(b => {
    if (!bowlingByInnings[b.scoreboard]) bowlingByInnings[b.scoreboard] = [];
    bowlingByInnings[b.scoreboard].push(b);
  });

  // Sort innings using scoreboards array
  const inningsOrder = scoreboards.map(sb => sb.scoreboard);

  return (
    <div className="scorecard-tab">
      {inningsOrder.map((inningKey, i) => {
        const batsmen = battingByInnings[inningKey] || [];
        const bowlers = bowlingByInnings[inningKey] || [];

        return (
          <div key={inningKey} className="innings-block">
            <h3>{i === 0 ? '1st Innings' : '2nd Innings'}</h3>

            <table className="scorecard-table">
              <thead>
                <tr>
                  <th>Batsman</th>
                  <th>R</th>
                  <th>B</th>
                  <th>4s</th>
                  <th>6s</th>
                  <th>SR</th>
                  <th>Dismissal</th>
                </tr>
              </thead>
              <tbody>
                {batsmen.map((batsman, idx) => (
                  <tr key={idx}>
                    <td>{playerIdToName[batsman.player_id] || 'N/A'}</td>
                    <td>{batsman.score}</td>
                    <td>{batsman.ball}</td>
                    <td>{batsman.four_x}</td>
                    <td>{batsman.six_x}</td>
                    <td>{batsman.rate}</td>
                    <td>{batsman.result || 'Not Out'}</td>
                  </tr>
                ))}
              </tbody>
            </table>

            <h4>Bowling</h4>
            <table className="scorecard-table">
              <thead>
                <tr>
                  <th>Bowler</th>
                  <th>O</th>
                  <th>M</th>
                  <th>R</th>
                  <th>W</th>
                  <th>Eco</th>
                </tr>
              </thead>
              <tbody>
                {bowlers.map((bowler, idx) => (
                  <tr key={idx}>
                    <td>{playerIdToName[bowler.player_id] || 'N/A'}</td>
                    <td>{bowler.overs}</td>
                    <td>{bowler.medians}</td>
                    <td>{bowler.runs}</td>
                    <td>{bowler.wickets}</td>
                    <td>{bowler.rate}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        );
      })}
    </div>
  );
};

export default ScorecardTab;
